import React from 'react'
import './todo.styles.css'
export default function Todo({name,description,deleteTodo,statusClicked, onStatusChange}) {
    const v = statusClicked === false ? 'IN PROGRESS' : "COMPLETED"
    return (
        <div className="todo">
            <h1>{name}</h1>
            <p>{description}</p>
            <button onClick={() => deleteTodo({name})}>-</button>
            <button onClick={() => onStatusChange}>{v}</button>
        </div>
    )
}
